INSERT INTO `task` VALUES ('22c764ce-d618-421e-b36e-d1315f4e12fc', 1, 'SOCIETY', '2023-11-07 09:51:28.970456', '这门课程旨在帮助学员更好地理解和与MBTI人格类型中的I人建立良好的人际关系。MBTI（Myers-Briggs Type Indicator）是一种常用的人格类型指标，其中的\"I\"代表内向型，这类人通常更喜欢独处，倾向于在思考中获得能量，对外部世界有一定的保留。\n\n在这门课程中，学员将学习如何理解I人的行为方式、沟通风格以及人际互动偏好。通过深入了解I人的内在需求和特点，学员将学会如何更好地与他们交流、建立信任和支持，以及如何避免可能的误解和冲突。课程内容还将涵盖有效的沟通技巧、倾听技能、情绪管理以及在不同情境下与I人建立有意义关系的方法。\n\n通过参与这门课程，学员将能够提升自己的人际交往能力，更好地适应多样化的人格类型，建立更加和谐、有益的人际关系，无论是在个人生活中还是职业领域中都能受益匪浅。', '2023-12-13 23:00:00.000000', '2023-11-01 12:00:00.000000', 'IN_PROGRESS', '如何和I人处理好关系？', '5cdc9422-7ed4-4161-830b-66af46a6f734');
INSERT INTO `task` VALUES ('49a32583-5a73-4c52-bb0c-f24231625f2a', 12, 'ANIMAL_HUSBANDRY', '2023-11-07 09:29:56.492300', '看看这张图片里面有没有小猫？只有聪明的孩子才能找到哦！', '2023-12-10 23:00:00.000000', '2023-11-02 18:00:00.000000', 'IN_PROGRESS', '你能找出下列图片的小猫吗？', '79ee93b5-efda-6120-56fe-dbd0eaf41119');
INSERT INTO `task` VALUES ('7ccb0b3f-152d-4268-a88e-e21634224332', 56, 'LANGUAGE', '2023-11-07 09:39:53.034521', '啊米诺斯！啊米诺斯！阿妈西诺斯！相信大家一定都听说过这样的歌谣，这是啊米诺斯民族的经典民谣，讲述的是歌唱伟大的啊米诺斯民族。那么我们应该如何入门啊米诺斯语呢？跟着老师来一起看看吧！', '2023-12-25 23:00:00.000000', '2023-11-01 12:00:00.000000', 'IN_PROGRESS', '啊米诺斯语怎么入门？', '5cdc9422-7ed4-4161-830b-66af46a6f734');
INSERT INTO `task` VALUES ('9f7fed9d-f221-4d0d-b2ad-4806dde7a84e', 15, 'AGRICULTURE', '2023-11-07 09:32:31.887325', '金坷垃（Jinkela）是一种号称由“美国圣地亚戈”研发、中国生产的肥料添加剂，以其制作的内容夸张不实的广告而走红于网络。而金坷垃的广告在经过AcFun、Bilibili等视频网站网友的恶搞之后传播范围变得更广，俨然成为一种新生网络文化。', '2023-12-11 23:00:00.000000', '2023-11-01 07:00:00.000000', 'IN_PROGRESS', '非洲农业不发达，必须要用金坷垃！', '5cdc9422-7ed4-4161-830b-66af46a6f734');
INSERT INTO `task` VALUES ('ce3d5684-aa06-49d4-be07-43642bb57da0', 1, 'HISTORY', '2023-11-07 09:53:06.895389', '这门课程旨在通过对历史上一些不寻常、独特甚至离奇的人物进行深入解析，帮助学员更全面地理解历史人物及其背后的历史背景、社会文化环境。通过对这些奇葩人物的学习，学员将能够拓宽对历史的认识，并且从中汲取启示。\n\n在课程中，学员将通过探讨各种各样的历史人物，包括但不限于古代君王、科学家、艺术家、政治家等，了解他们的生平、成就、以及他们对历史进程产生的影响。同时，课程还将重点分析这些人物的特立独行之处，他们不同寻常的思想、行为，以及他们在当时社会中所引发的争议和反响。\n\n通过对这些奇葩人物的深入研究，学员将获得对历史的新颖视角，并且能够从中了解到不同个体如何影响着历史的发展，以及历史对个体的塑造。课程还将鼓励学员在对比和分析中培养批判性思维和跨学科的认知能力，拓展对历史和人类行为的理解。', '2023-12-03 23:00:00.000000', '2023-11-01 12:00:00.000000', 'IN_PROGRESS', '盘点历史上那些奇葩人物', '5cdc9422-7ed4-4161-830b-66af46a6f734');
INSERT INTO `task` VALUES ('d0b32f32-f615-48c0-9d8f-1871cf6237c6', 20, 'HYGIENE', '2023-11-07 09:44:34.593778', '这门课程将专注于教导学生正确的洗澡方法及注意事项。课程将详细介绍身体各部位在洗澡时需要特别注意清洁的地方，包括但不限于头发、面部、腋下、私密部位、手脚等。学生将学习到如何选择适合自己肤质的清洁用品，以及正确的沐浴步骤和技巧。通过实际示范和讨论，学生将掌握清洁身体各部位的正确方法，了解保持身体清洁对健康的重要性，并养成良好的卫生习惯。这门课程旨在提高学生对身体清洁的认识，培养良好的个人卫生习惯，促进他们的健康生活方式。', '2023-12-25 23:00:00.000000', '2023-11-01 12:00:00.000000', 'IN_PROGRESS', '讲卫生！跟我做！', '5cdc9422-7ed4-4161-830b-66af46a6f734');
INSERT INTO `task` VALUES ('e1acd401-4f90-492a-bb94-49823b19fea2', 34, 'SOCIETY', '2023-11-07 09:41:38.435299', '这门课程将带领学生深入探讨人类走路的科学原理，通过跟着说的道理一起学习的方式，了解人类是如何像走路这样简单的动作。课程将涵盖生物力学、神经科学和运动控制等多个领域的知识，帮助学生理解走路背后的复杂机制。通过实例分析和动手实践，学生将能够更好地理解人体运动的本质，并掌握相关的科学方法和技能。这门课程旨在激发学生对科学的兴趣，同时提高他们对人类身体运动的理解和认识。', '2023-12-25 23:00:00.000000', '2023-11-01 12:00:00.000000', 'IN_PROGRESS', '跟着说的道理一起学科学！如何像人类一样走路？', '5cdc9422-7ed4-4161-830b-66af46a6f734');
INSERT INTO `task` VALUES ('ff66789d-95a4-436c-b293-8e1c9a8d00d2', 1000, 'POLITICS', '2023-11-07 09:56:07.393148', '习近平新时代中国特色社会主义思想是引领中国、影响世界的当代中国马克思主义、二十一世纪马克思主义，是新时代中国共产党的思想旗帜和精神旗帜。随着中华民族伟大复兴进入关键时期，我们越来越深刻地认识到，必须进一步深化对这一重要思想作为当代中国马克思主义、二十一世纪马克思主义的认识，进一步深入理解习近平新时代中国特色社会主义思想的理论创新与时代价值。作为马克思主义在当代中国、在二十一世纪的理论形态，习近平新时代中国特色社会主义思想推动马克思主义中国化时代化实现了重大发展，指引中国特色社会主义进入了新时代，从理论与实践的结合上科学回答了中国之问、世界之问、人民之问、时代之问。这一重要思想开辟了马克思主义科学性、人民性、实践性、开放性的新境界，闪烁着耀眼的真理光芒。', '2023-12-31 23:00:00.000000', '2023-01-01 12:00:00.000000', 'IN_PROGRESS', '习近平新时代中国特色社会主义思想的理论创新与时代价值（深入学习贯彻习近平新时代中国特色社会主义思想）', '5cdc9422-7ed4-4161-830b-66af46a6f734');

